    false,nt"url": null,nt"notes": "Light Detection and Ranging (LiDAR) data
    is remotely sensed high-resolution elevation data collected by an airborne collection
    platform. LiDAR was flown for approximately 1675 square miles in Passaic, Sussex,
    Bergen, Morris, Warren, Hunterdon, and Somerset Counties in New Jersey and a small
    part of Orange County, New York with an Root Mean Square Error (RMSE) of 18.5 centimeters
    vertically and 95% confidence level. This data will be used by the NJ Highlands
    Council and/or the United States Army corps of Engineers (USACE) to generate contours
    for use in watershed analysis and model development, and for assessing environmental
    impacts. The LiDAR was flown during leaf-off, no snow on the ground, and water levels
    in streams that were at normal or below base level.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
